Kate and Pippa: The Middletons


1)  Kate 
Since the day of Kate and Will's wedding last year The Middleton sisters have reached a level of fame that only the biggest superstars can aspire to. The wedding was watched around the world and the press coverage was exhaustive. But the talk was not only of Kate and Will, but also of the younger Middleton sister, Pippa. Pippa too has taken to public life admirably; it seems this ambitious young ingÃƒÂ©nue had been waiting her whole life for the chance to shine and is now ready to take centre stage. These programmes give a new perspective on the girl s lives, covering not only since becoming nationwide household names, but also their up-bringing and university days. With contributions from family, friends and their peers offering a rounded view on life as a Middleton.

2)  Pippa 
Friday April 29th -- The whole world turned up and tuned in to see the wedding of commoner Kate Middleton to the world's most eligible bachelor, Prince William of Wales, but what they walked away talking about was Kate's gorgeous maid-of-honor, her sister Phillipa &quot;Pippa&quot; Middleton. And, while Pippa was seemingly introduced to the world that famous day in April, she'd actually been cultivating her image and socialite status for years. And now, Pippa has reached a new level of fame, one that is even trickier to navigate, but this ambitious young women has been waiting her whole life for this day, and is ready to take center stage.

